B.a0q=new A.f8("1. Aceita\xe7\xe3o dos Termos",null)
B.a05=new A.eR("Ao criar uma conta ou usar o Par Crist\xe3o, voc\xea concorda em cumprir estes Termos de Uso. Se voc\xea n\xe3o concordar com qualquer parte destes termos, n\xe3o dever\xe1 usar nosso servi\xe7o.",null)
B.a0m=new A.f8("2. Elegibilidade",null)
B.a0b=new A.eR("Voc\xea deve ter pelo menos 18 anos de idade para usar este aplicativo. Ao usar o servi\xe7o, voc\xea declara e garante que tem o direito, autoridade e capacidade para celebrar este contrato.",null)
B.a0s=new A.f8("3. Conduta do Usu\xe1rio",null)
B.a0g=new A.eR("Esperamos que todos os usu\xe1rios mantenham um comportamento respeitoso e crist\xe3o. \xc9 proibido:\n\u2022 Assediar ou intimidar outros usu\xe1rios.\n\u2022 Publicar conte\xfado ofensivo, obsceno ou ilegal.\n\u2022 Usar o servi\xe7o para fins comerciais n\xe3o autorizados.\n\u2022 Criar perfis falsos ou se passar por outra pessoa.",null)
B.a0k=new A.f8("4. Rescis\xe3o",null)
B.a04=new A.eR("Reservamo-nos o direito de suspender ou encerrar sua conta a qualquer momento, sem aviso pr\xe9vio, se acreditarmos que voc\xea violou estes Termos.",null)
B.a0l=new A.f8("5. Isen\xe7\xe3o de Responsabilidade",null)
B.a0d=new A.eR('O servi\xe7o \xe9 fornecido "como est\xe1". N\xe3o garantimos que o servi\xe7o ser\xe1 ininterrupto ou livre de erros.\n\nIMPORTANTE: N\xe3o nos responsabilizamos pela veracidade das informa\xe7\xf5es fornecidas por outros usu\xe1rios. N\xe3o realizamos verifica\xe7\xe3o de antecedentes criminais. Voc\xea \xe9 o \xfanico respons\xe1vel por suas intera\xe7\xf5es e deve ter cautela ao compartilhar informa\xe7\xf5es pessoais. N\xe3o nos responsabilizamos por qualquer engano, dano ou preju\xedzo decorrente de intera\xe7\xf5es com outros usu\xe1rios.',null)
B.a0y=new A.f8("6. Selo de Verifica\xe7\xe3o",null)
B.a09=new A.eR("O selo de verifica\xe7\xe3o (\xedcone azul ao lado do nome) indica que o usu\xe1rio passou por um processo de verifica\xe7\xe3o de identidade atrav\xe9s de selfie com gesto.\n\nIMPORTANTE:\n\u2022 Apenas perfis com o selo de verifica\xe7\xe3o foram verificados.\n\u2022 Perfis SEM o selo n\xe3o passaram por verifica\xe7\xe3o de identidade.\n\u2022 A verifica\xe7\xe3o confirma apenas que a pessoa corresponde \xe0s fotos do perfil, N\xc3O garante car\xe1ter, inten\xe7\xf5es ou antecedentes.\n\u2022 Se um usu\xe1rio verificado alterar suas fotos, o selo \xe9 removido automaticamente e uma nova verifica\xe7\xe3o ser\xe1 necess\xe1ria.\n\nRecomendamos cautela adicional ao interagir com perfis n\xe3o verificados.",null)
B.Ud=s([B.a0q,B.a05,B.a0m,B.a0b,B.a0s,B.a0g,B.a0k,B.a04,B.a0l,B.a0d,B.a0y,B.a09],t.p)
B.Sm=new A.xz("Termos de Uso",B.Pr,B.Ud,null)
B.PV=new A.at(62160,"MaterialIcons",!1)
B.a01=new A.eR("Sua privacidade \xe9 muito importante para n\xf3s. Esta pol\xedtica descreve como coletamos, usamos e protegemos suas informa\xe7\xf5es pessoais.",null)
B.a0v=new A.f8("1. Informa\xe7\xf5es que Coletamos",null)
B.a08=new A.eR("Coletamos informa\xe7\xf5es que voc\xea nos fornece diretamente, como:\n\u2022 Dados de cadastro (nome, e-mail, data de nascimento).\n\u2022 Informa\xe7\xf5es do perfil (fotos, bio, igreja, interesses).\n\u2022 Localiza\xe7\xe3o (para mostrar pessoas pr\xf3ximas).\n\nColetamos informa\xe7\xf5es sobre sua denomina\xe7\xe3o religiosa estritamente para conectar voc\xea com perfis compat\xedveis, conforme o objetivo do aplicativo.",null)
B.a0x=new A.f8("2. Como Usamos Seus Dados",null)
B.a0h=new A.eR("Usamos suas informa\xe7\xf5es para:\n\u2022 Operar e melhorar o servi\xe7o.\n\u2022 Conectar voc\xea com outros usu\xe1rios compat\xedveis.\n\u2022 Enviar notifica\xe7\xf5es importantes.\n\u2022 Garantir a seguran\xe7a da comunidade.",null)
B.a0p=new A.f8("3. Compartilhamento de Informa\xe7\xf5es",null)
B.a06=new A.eR("N\xe3o vendemos seus dados pessoais. Compartilhamos informa\xe7\xf5es apenas quando necess\xe1rio para operar o servi\xe7o (ex: provedores de infraestrutura) ou quando exigido por lei.",null)
B.a0w=new A.f8("4. Seguran\xe7a",null)
B.a0c=new A.eR("Implementamos medidas de seguran\xe7a para proteger seus dados contra acesso n\xe3o autorizado. No entanto, nenhum sistema \xe9 100% seguro.",null)
B.a0r=new A.f8("5. Seus Direitos",null)
B.a0i=new A.eR("Voc\xea pode acessar, corrigir ou excluir sua conta e seus dados a qualquer momento atrav\xe9s das configura\xe7\xf5es do aplicativo.",null)
B.a0j=new A.f8("6. Verifica\xe7\xe3o de Perfil",null)
B.a0e=new A.eR("Oferecemos um sistema volunt\xe1rio de verifica\xe7\xe3o de identidade atrav\xe9s de selfie com gesto. Ao solicitar verifica\xe7\xe3o:\n\n\u2022 Voc\xea nos envia uma selfie realizando um gesto espec\xedfico.\n\u2022 Comparamos a selfie com as fotos do seu perfil.\n\u2022 Se aprovado, seu perfil recebe um selo de verifica\xe7\xe3o (\xedcone azul).\n\u2022 Se voc\xea alterar suas fotos ap\xf3s a verifica\xe7\xe3o, o selo \xe9 removido automaticamente.\n\nA selfie de verifica\xe7\xe3o \xe9 armazenada de forma segura e utilizada exclusivamente para fins de verifica\xe7\xe3o de identidade.",null)
