B.a02=new A.eR("Nunca envie dinheiro ou informa\xe7\xf5es de cart\xe3o de cr\xe9dito para ningu\xe9m que voc\xea conheceu no aplicativo. Se algu\xe9m pedir dinheiro, denuncie imediatamente.",null)
B.a0n=new A.f8("2. Mantenha Conversas na Plataforma",null)
B.a0a=new A.eR("Recomendamos manter as conversas dentro do aplicativo at\xe9 que voc\xea se sinta confort\xe1vel e seguro para trocar n\xfameros de telefone.",null)
B.a0z=new A.f8("3. Encontros Presenciais",null)
B.a07=new A.eR("Ao encontrar algu\xe9m pela primeira vez:\n\u2022 Escolha um local p\xfablico e movimentado.\n\u2022 Avise um amigo ou familiar onde voc\xea vai.\n\u2022 Tenha seu pr\xf3prio meio de transporte.\n\u2022 Confie nos seus instintos.",null)
B.a0u=new A.f8("4. Relate Comportamentos Suspeitos",null)
B.a03=new A.eR("Voc\xea pode bloquear e denunciar qualquer usu\xe1rio que viole nossos termos ou fa\xe7a voc\xea se sentir desconfort\xe1vel. Isso ajuda a manter a comunidade segura para todos.",null)
B.a0o=new A.f8("5. Consentimento e Respeito",null)
B.a0f=new A.eR("O respeito \xe9 fundamental. Todos os limites devem ser respeitados. Se voc\xea n\xe3o se sentir confort\xe1vel, tem todo o direito de encerrar a intera\xe7\xe3o.",null)
